insert into pyd_Visitas (Id_Visita, Fecha, Sintomas, Examen, Diagnostico, Tratamiento, paciente_id) values (4, '12/17/2024', 'Praesent id massa id nisl venenatis lacinia. Aenean sit amet justo. Morbi ut odio.', 'Ecografa abdominal', 'Duis bibendum, felis sed interdum venenatis, turpis enim blandit mi, in porttitor pede justo eu massa. Donec dapibus. Duis at velit eu est congue elementum.', 'fexofenadine hydrochloride and pseudoephedrine hydrochloride', 472);
